import React from "react";
import styled from "styled-components";
import { Colors } from "../../constants/colors";
import { AuthButtons, NavbarLinks } from "./NavbarLinks";

interface Props {
  isVisible: boolean;
}

const StyledMobileMenu = styled.div`
  display: ${({ isVisible }: Props) => (isVisible ? "flex" : "none")};
`;

export const MobileMenu: React.FC<Props> = ({ isVisible }) => {
  return (
    <StyledMobileMenu isVisible={isVisible}>
      <NavbarLinks isInMobileMode={true} />
    </StyledMobileMenu>
  );
};
